import React from 'react';
import './App.css';
import MainContainer from './containers/mainContainer';
import Navbar from './components/navBar';


function App() {


  return (

    <div className="App">  
          <Navbar/>
          <MainContainer/>
    </div>

  );
}

export default App;

function mapStateToProps(state) {
  return {
    user_id: state.userId
  };
}
